package program;

public class NestedIfelse {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a =50;
		int b=20;
		
		if (a==b)
		{
			System.out.println("if block");
		}
		else if (a<=b)
		{
			System.out.println("else if block");
		}
		else
		{
			System.out.println("else block");
		}
		
		
	}

}
